import React from 'react'
import Person from './Person'

function PersonList({person}) {

    //<h2>{person.id},{person.name}, {person.age}</h2>

    const personList = persons.map(person => <Person person = {person}/>)
    

    return (

        <div>{personList}</div>

    )
}

export default PersonList
